const contactForm=document.getElementById("contactForm");contactForm.addEventListener("submit",(t=>{t.preventDefault(),alert("Thank you for your message! We will get back to you soon."),contactForm.reset()}));const faqCards=document.querySelectorAll(".faq-card");faqCards.forEach((t=>{t.querySelector(".faq-question").addEventListener("click",(()=>{t.classList.toggle("active")}))}));